var data = msg.payload;

// get the column names form the first object in the array
var columns = Object.keys(data[0])

// remove spaces from column names
var newData = data.map(function(row) {
    var newRow = {};
    columns.forEach(function(col) {
        var newCol = col.trim().replace(/\s+/g,'');
        newRow[newCol] = row[col];
    });
    return newRow;
});

// set the new modofed data back to the payload
msg.payload = newData;

return msg;

// this query inserts a new record into snmp_oids table for each OID
// unless there is an existing record with the same devicename and oid,
// in which case this record is updated with the payload value and tstr
msg.topic = `
INSERT INTO snmp_objects (devicename, oid, value, tstr, updated)
VALUES ($devicename, $oid, $value, $tstr, CURRENT_TIMESTAMP)
ON CONFLICT(devicename, oid) DO UPDATE SET
value = excluded.value,
tstr = excluded.tstr,
updated = excluded.updated;
`;

// check if payload is an array or single object
if (Array.isArray(msg.payload)) {
    msg.payload = msg.payload.map(item => [
        msg.devicename,
        item.oid,
        item.value !== undefined && item.value !== null ? item.value.toString() : null, // convert value to string if it's not null
        item.tstr
    ]);
} else {
    msg.payload = [[
        msg.payload.devicename,
        msg.payload.oid,
        msg.payload.value !== undefined && msg.payload.value !== null ? msg.payload.value.toString() : null, // convert value to string if it's not null
        msg.payload.tstr
    ]];
}

return msg;

