msg.topic = `
CREATE TABLE IF NOT EXISTS snmp_objects (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    devicename TEXT,
    oid TEXT,
    objectname TEXT,
    value TEXT,
    tstr TEXT,
    updated DATETIME,
    UNIQUE(devicename, oid)
);
`;
return msg;

